import React from "react";
import Authorisedroute from "../components/Authorisedroute";

const EmployeeHome = () => {
    const spacing = 18;
    return (
        <Authorisedroute>
            <div
                style={{
                    backgroundColor: "#343a40",
                    minHeight: "100vh",
                    color: "white",
                    padding: spacing,
                }}
            >
                <div className="card bg-dark text-white" style={{ margin: 0 }}>
                    <div className="card-body">
                        <h5 className="card-title">TRL Employee Home</h5>
                        <p className="card-text">
                            To view the list of applicants who have submitted details, click on the Applicant button in the header
                        </p>
                        <p className="card-text">
                            To view the list of jobs and to see a list of applicants suitable for those jobs, click on Jobs in the header
                        </p>
                        <p className="card-text">
                            To create a new job, click on Add a Job
                        </p>
                        <p className="card-text">
                            To view the non-employee home page, click on the TRL logo
                        </p>
                    </div>
                </div>
            </div>
        </Authorisedroute>
    );
};

export default EmployeeHome;
